  \"2015-01-22T15:57:36.480186\",\n\t\"name\": \"fha-insured-in-force-properties-by-census-tract\",\n\t\"isopen\":
  false,\n\t\"url\": null,\n\t\"notes\": \"The Federal Housing Administration, generally
  known as FHA, provides mortgage insurance on loans made by FHA-approved lenders
  throughout the United States and its territories. FHA insures mortgages on single
  family and multifamily homes including manufactured homes and hospitals. It is the
  largest insurer of mortgages in the world, insuring over 34 million properties since
  its inception in 1934. The insurance is force represents the outstanding balance
  of an active loan.\",\n\t\"license_title\": \"License Not Specified\",\n\t\"extras\":
